const Country = (props) => (
  <div>
    <h1>{props.name}</h1>
    capital {props.capital}
    population {props.population}
    <h2>
      <ul>
        {props.languages.map((language) => (
          <li>{language}</li>
        ))}
      </ul>
    </h2>
    <img>{props.flag}</img>
  </div>
);

export default Country;
